paths:
  tmp0:
    post:
      description: Get a specific ASM Alert.
      parameters:
      - description: ASM event ID
        example: '13823969381731795200'
        in: query
        name: Event ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: F5 BIG-IP Networks Get single ASM Event details
  tmp1:
    post:
      description: Get the ASM logs from a given period of time.
      parameters:
      - description: Subtracts the specified amount of time from the current time.
        example: 5M = 5 Minutes or 1h = Hour or 1d = 1 day
        in: query
        name: Time Period
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: F5 BIG-IP Networks Get ASM Events
