          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: F5 BIG-IP Networks Create Pool
  tmp3:
    post:
      description: Executes virtual server creation F5 server.
      parameters:
      - description: The name of the F5 pool.
        example: test_pool
        in: query
        name: Pool Name
        required: true
        schema: {type: string}
      - description: The name of the virtual server
        example: Test Server
        in: query
        name: Server Name
        required: true
        schema: {type: string}
      - description: A description of the virtual server
        example: This is a test virtual server
        in: query
        name: Description
        required: false
        schema: {type: string}
      - description: The IP of the virtual server
        example: 192.168.1.1
        in: query
        name: IP
        required: true
        schema: {type: string}
      - description: The port of the virtual server
        example: '80'
        in: query
